import React from "react";

import FullPageImage from "../common/FullWidthImage";
import Layer from "../common/Layer";

import image from "../../img/dc.jpg";

import icon from "../../img/dc-logo.jpg";

export default function ChooseQuiz() {
    return (
        <div className="choose-quiz-container">
            <FullPageImage image={image} alt="dc" />
            <Layer />
            <div className="container">
                <div className="description">
                    <img src={icon} alt="icon" />
                    <p>From the films to the comic books, test your knowledge of some of the world's greatest superheroes and villains.</p>
                </div>
                <div className="list">

                </div>
            </div>
        </div>
    )
}
